import React, { useContext } from "react";
import { AuthContext } from "../../context/AuthContext";
import "./header.css";

const Header = () => {
    const { user } = useContext(AuthContext);

    return (
        <div className="header">
            <form>
                <div className="searchIcon" onClick={handleHomeBtn}>
                    <FontAwesomeIcon
                        icon={famagnifying - glass}
                        color="<>"
                        fontSize="50px"
                    />
                </div>
                <input
                    className="searchInput"
                    name="searchInput"
                    type="text"
                ></input>
            </form>
            <a className="headerBtn" href="/upload">
                Upload
            </a>
            <a className="headerBtn" href="/library">
                Library
            </a>
        </div>
    );
};

export default Header;
